import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="left-content">
        <p>Powered by</p>
        <img src={`${process.env.PUBLIC_URL}/images/DH.png`} alt="DH-logo" />
      </div>
      <div className="right-content">
        <img src={`${process.env.PUBLIC_URL}/images/facebook.png`} alt="Facebook" />
        <img src={`${process.env.PUBLIC_URL}/images/instagram.png`} alt="Instagram" />
        <img src={`${process.env.PUBLIC_URL}/images/tiktok.png`} alt="TikTok" />
        <img src={`${process.env.PUBLIC_URL}/images/whatsapp.png`} alt="WhatsApp" />
      </div>
    </footer>
  );
};

export default Footer;
